import axios from 'axios';
import React, {Component} from 'react';

export default class HeaderDisplay extends Component {

    render(){
        
        axios.get("https://api.coingecko.com/api/v3/global");

        return(
            <div>
                <h6>Coins: </h6>
                <h6>Exchanges: </h6>
                <h6>Market Cap: </h6>
                <h6>24h Vol: </h6>
                <h6>Dominance: </h6>
            </div>
        )
    }
}
